import React from 'react';
import { Card, Button, CardTitle, CardText } from 'reactstrap';

import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">

        <Card className="App-body" body inverse style={{ backgroundColor: '#333', borderColor: '#333' }}>

          <CardTitle>
            <img src={logo} className="App-logo" alt="logo" />
          </CardTitle>

          <CardText>
            <p>Ao responder o questionário saberemos o que a plataforma deve ter...</p>
          </CardText>

          <Button>
              <a
                className="App-link"
                href="https://forms.gle/rbKdZStyWd5vVeVb6"
                target="_blank"
                rel="noopener noreferrer"
              >
                Clique para responder nosso questionário
              </a>
          </Button>

        </Card>
      </header>
    </div>  
  );
}

export default App;
